import { Link } from "react-router-dom";
import { Fragment } from "react";
import styles from "./styles.module.scss";
import ClosetCard from "./card";

const Closets = ({closets}) => {
    return(
        <Fragment>
            {closets.map(c => (

                <div className={styles.closet}>
                    <ClosetCard closet={c}/>
                </div>

            ))
            }
        </Fragment>
    );
};

export default Closets;
